% PHreal2.m: Used by the PG to determine the pulse amplitude% This is a simple example of how to use an m-file from within SIMULINK  % Written by:  Jonathan Jacobs%              May 1998  (last mod: 05/29/98)function y = PHreal2( u )breakpt = 2.0;coeffLo(1) = -291.8705017;coeffLo(2) = 3557.341563;coeffLo(3) = -18982.22446;coeffLo(4) = 58296.93006;coeffLo(5) = -114019.2051;coeffLo(6) = 148574.879;coeffLo(7) = -131333.0591;coeffLo(8) = 78815.47173;coeffLo(9) = -31638.86848;coeffLo(10) = 8182.895329;coeffLo(11) = -1273.340648;coeffLo(12) = 133.2902406;coeffLo(13) = -3.38274852; coeffHi(1) = -1.427639097e-016;coeffHi(2) = 4.835029989e-014;coeffHi(3) = -7.327111e-012;coeffHi(4) = 6.566614359e-010;coeffHi(5) = -3.877763764e-008;coeffHi(6) = 1.592846788e-006;coeffHi(7) = -0.00004690766574;coeffHi(8) = 0.001008852889;coeffHi(9) = -0.01607470538;coeffHi(10) = 0.1930572872;coeffHi(11) = -1.797155575;coeffHi(12) = 14.11990406;coeffHi(13) = 0.3347396786;numCo = length(coeffLo);if (abs(u)<=breakpt)   y = 0;   for i = 1:numCo      y = y + (coeffLo(i) * abs(u)^(numCo-i));   end elseif (abs(u)>breakpt)   y = 0;   for i = 1:numCo      y = y + (coeffHi(i) * abs(u)^(numCo-i));   endendif (abs(u)>50)   y=105.8105;endy=y*sign(u);